import React from 'react';
import './App.css';
import Banner from './Banner';
import Main from './Main';

class App extends React.Component {
  render() {
    return (
      <div className='App'>
        <div className="App-header">
          <Banner/>
          <div className="page-body">
            <Main/>
          </div>
        </div>
      </div>
    );
  }
}

export default App;
